var suggestions=document.getElementById("suggestions"),search=document.getElementById("search");search!==null&&document.addEventListener("keydown",inputFocus);function inputFocus(e){e.ctrlKey&&e.key==="/"&&(e.preventDefault(),search.focus()),e.key==="Escape"&&(search.blur(),suggestions.classList.add("d-none"))}document.addEventListener("click",function(e){var t=suggestions.contains(e.target);t||suggestions.classList.add("d-none")}),document.addEventListener("keydown",suggestionFocus);function suggestionFocus(n){const s=suggestions.classList.contains("d-none");if(s)return;const e=[...suggestions.querySelectorAll("a")];if(e.length===0)return;const t=e.indexOf(document.activeElement);if(n.key==="ArrowUp"){n.preventDefault();const s=t>0?t-1:0;e[s].focus()}else if(n.key==="ArrowDown"){n.preventDefault();const s=t+1<e.length?t+1:t;e[s].focus()}}(function(){var e=new FlexSearch.Document({tokenize:"forward",cache:100,document:{id:"id",store:["href","title","description"],index:["title","description","content"]}});e.add({id:0,href:"/docs/hugo/install/",title:"Instalar",description:"Como instalar Hugo y la plantilla Doks",content:"Requerimientos #\rGit #\rPrimeramente tendremos que instalar git para descargar el tema. Git para windows\n\rRepaso sobre git\rSi quieres recordar como funciona git y sus comandos visita el quickstart de git A partir de esto, instalamos el tema en una carpeta con el siguiente comando:\n\rgit clone https://github.com/h-enk/doks-child-theme.git my-doks-site \u0026amp;\u0026amp; cd my-doks-site\r Nodejs y npm #\rNodejs permite ejecutar cÃ³digo javascript de manera local. A su vez, npm es un administrador de instalaciones de nodejs, con capacidad para manejar e instalar mÃ³dulos. Se instala en el siguiente enlace\nEsto inclurÃ­a los comandos node y npm en nuestra consola.\nA continuaciÃ³n ejecutamos el comando npm install. El cual instalarÃ¡ todos los modules necesarios para el desarrollo.\nPrueba de funcionamiento #\rPara probar el funcionamiento de Doks podemos hacer un host de la pÃ¡gina. Esto usarÃ¡ los archivos markdown y la configuraciÃ³n de prueba que viene en el repositorio que hemos descargado y lo alojarÃ¡ en una pÃ¡gina web.\nEl comando a ejecutar es: npm run start. Al terminar de ejecutarse alojarÃ¡ una pÃ¡gina web en esta direcciÃ³n\n"}),e.add({id:1,href:"/docs/hugo/create_content/",title:"Crear contenido",description:"Como crear contenido",content:"Estructura de carpetas #\rDentro de la carpeta docs existen diferentes carpetas donde estÃ¡n organizados todos los proyectos/categorÃ­as. TambiÃ©n algunas carpetas que vienen de prueba cuando instalas el Doks, las cuales muestran algunas de las funcionalidades del mÃ³dulo.\nSi acabas de descargarte e instalado hugo y doks es recomendable echarle un vistazo a la carpeta prologue dentro de docs para ver un poco la organizaciÃ³n que sigue.\nNuevo proyecto/categorÃ­a #\rPara crear un nuevo proyecto/categorÃ­a primero tendremos que crear una carpeta dentro de docs. Esta puede tener cualquier nombre pero se recomienda que indique el proyecto que es. A continuaciÃ³n se necesita generar un archivo con el nombre _index.md. Es importante que siga este nombre ya que si no Doks no lo va a reconocer. Este archivo cumple la funciÃ³n de especificar datos sobre el proyecto.\nEl contenido del archivo debe de ser como lo siguiente\n\r---\rtitle : \u0026quot;Hugo - DocumentaciÃ³n\u0026quot;\rdescription: \u0026quot;Prologue Doks.\u0026quot;\rlead: \u0026quot;\u0026quot;\rdate: 2020-10-06T08:48:45+00:00\rlastmod: 2020-10-06T08:48:45+00:00\rdraft: false\rweight: 0\r---\r Esto es lo que llamamos cabecera. Sus parÃ¡metros son los siguientes\n title: nombre que queramos que aparezca en el indice de proyectos. description: breve descripciÃ³n del proyecto lead: lo que aparecerÃ¡ en el primer pÃ¡rrafo. En este caso no sirve de nada ya que esta pÃ¡gina no se verÃ¡. Si nos serÃ¡ Ãºtil cuando estemos escribiendo el contenido de la pÃ¡gina date y lastmod: fecha de creaciÃ³n y modificaciÃ³n respectivamente draft: indica si es un borrador.   weight: La posiciÃ³n que ocuparÃ¡ en el indice. 100 es la primera, 110 la segunda, 120 la segunda\u0026hellip;  El weight en el sidebar por defecto se hace de forma inversa para los menÃºs. Para cambiar esto, vamos al archivo layouts/partials/sidebar/auto-collapsible-menu.html y cambiamos la linea:\n{{ range .Sections.ByWeight.Reverse }}\r por:\n{{ range .Sections.ByWeight }}\r Contenido en el proyecto #\rComo se ha mencionado anteriomente, esta pÃ¡gina del menu no es accesible. Podemos aÃ±adir contenido debajo de la cabecera pero a menos que cambiemos la url no podremos acceder manualmente a esta. Tampoco es que sea necesario ya que la barra de la izquierda nos permitirÃ¡ navegar entre los proyectos, lo que quita la necesidad de entrar a la pÃ¡gina de un proyecto.\nCrear contenido #\rCrear contenido es muy similar a crear un proyecto. De hecho, es necesario poner la cabecera que hemos mencionado anteriormente y especificar el orden con weight, especificar un nombre, el lead, etc\nDebajo de esto empezaremos a redactar el contenido.\nPara insertar texto simple, tendremos que simplemente escribirlo debajo de la cabecera. A continuaciÃ³n se explicarÃ¡ mÃ¡s en detalles caracterÃ­sticas especiales de markdown y hugo.\nCabe destacar que el plugin Doks utiliza una especie de \u0026ldquo;compilador de markdown\u0026rdquo; llamado goldmark. Este permite instalar plugin que extienden la funcionalidad del markdown bÃ¡sico\nTipo de titulos #\rPodremos especificar el tamaÃ±o de los titulos usando el caracter #. Todos los titulos que aÃ±adamos se pondrÃ¡n en el Ã­ndice de la derecha de la pÃ¡gina automÃ¡ticamente\nDependiendo de cuantas # pongamos el titulo serÃ¡ mÃ¡s grande o menos. Por ejemplo:\n# Titulo\r## Subtitulo\r### SubSubTitulo\r#### a\r##### b\r###### c\r Esto generÃ¡ lo siguiente:\nImÃ¡genes #\râš ï¸ \rCrear \r\r--\rSi queremos incluir imÃ¡genes primero tendremos que crear una carpeta nueva dentro del proyecto para la pÃ¡gina de contenido que estemos redactando actualmente. Se recomienda llamarla igual que el archivo markdown que estabamos redactando. A continuaciÃ³n moveremos el archivo md con el contenido que estabamos redactando a esta carpeta, cambiandole el nombre a index.md. Aunque le estemos cambiando el nombre y la carpeta padre, la cabecera funcionarÃ¡ exactamente igual, por lo que no tendremos que cambiar la configuraciÃ³n.\n..\râ”œâ”€â”€ blog/\râ”‚ â”œâ”€â”€ say-hello-to-doks/\râ”‚ â”‚ â”œâ”€â”€ index.md\râ”‚ â”‚ â””â”€â”€ say-hello-to-doks.png\râ”‚ â””â”€â”€ _index.md\râ””â”€â”€ _index.md\r A continuaciÃ³n, meteremos todas las imÃ¡genes que queramos usar dentro de esta carpeta. Para mostrarlas en la pÃ¡gina usaremos lo siguiente\n![cap](Captura.png)\r donde:\n cap es el nombre que queremos ponerle a la imÃ¡gen en la pÃ¡gina. Puede ser cualquiera y no tiene que ser igual al nombre del archivo Captura.png es la imÃ¡gen que queremos poner.  a task list item\rlist syntax required\rincomplete\rcompleted\r\r- [ ] Mercury - [ ] Venus\r- [ ] Earth (Orbit/Moon)\r- [ ] Mars\r- [ ] Jupiter\r- [ ] Saturn\r- [ ] Uranus\r- [ ] Neptune\r- [ ] Comet Haley\r--\r"}),e.add({id:2,href:"/docs/big-data/introduction/",title:"Introduction",description:"Doks is a Hugo theme for building secure, fast, and SEO-ready documentation websites, which you can easily update and customize.",content:"Get started #\rThere are two main ways to get started with Doks:\nTutorial #\rðŸ‘‰ \rThe Tutorial is intended for novice to intermediate users. \r\rStep-by-step instructions on how to start a new Doks project. Tutorial â†’\nQuick Start #\rðŸ‘‰ \rThe Quick Start is intended for intermediate to advanced users. \r\rOne page summary of how to start a new Doks project. Quick Start â†’\nGo further #\rRecipes, Reference Guides, Extensions, and Showcase.\nRecipes #\rGet instructions on how to accomplish common tasks with Doks. Recipes â†’\nReference Guides #\rLearn how to customize Doks to fully make it your own. Reference Guides â†’\nExtensions #\rGet instructions on how to add even more to Doks. Extensions â†’\nShowcase #\rSee what others have build with Doks. Showcase â†’\nContributing #\rFind out how to contribute to Doks. Contributing â†’\nHelp #\rGet help on Doks. Help â†’\n"}),e.add({id:3,href:"/docs/hugo/",title:"Hugo - DocumentaciÃ³n",description:"Prologue Doks.",content:""}),e.add({id:4,href:"/docs/big-data/quick-start/",title:"Quick Start",description:"One page summary of how to start a new Doks project.",content:"Requirements #\r Git â€” latest source release Node.js â€” latest LTS version or newer  \rWhy Node.js?\rDoks uses npm (included with Node.js) to centralize dependency management, making it easy to update resources, build tooling, plugins, and build scripts. Start a new Doks project #\rCreate a new site, change directories, install dependencies, and start development server.\nCreate a new site #\rDoks is available as a child theme and a starter theme.\nChild theme #\r Intended for novice to intermediate users Intended for minor customizations Easily update npm packages â€” including Doks  git clone https://github.com/h-enk/doks-child-theme.git my-doks-site\r Starter theme #\r Intended for intermediate to advanced users Intended for major customizations Easily update npm packages  git clone https://github.com/h-enk/doks.git my-doks-site\r \rHelp me choose\rNot sure which one is for you? Pick the child theme. Change directories #\rcd my-doks-site\r Install dependencies #\rnpm install\r Start development server #\rnpm run start\r Doks will start the Hugo development webserver accessible by default at http://localhost:1313. Saved changes will live reload in the browser.\nOther commands #\rDoks comes with commands for common tasks. Commands â†’\n"}),e.add({id:5,href:"/docs/odoo/",title:"Odoo",description:"Prologue Doks.",content:""}),e.add({id:6,href:"/docs/big-data/",title:"Big Data",description:"Prologue Doks.",content:""}),e.add({id:7,href:"/docs/big-data/commands/",title:"Commands",description:"Doks comes with commands for common tasks.",content:"ðŸ’¡ \rYou can change the commands in the scripts section of `./package.json`. \r\rcreate #\rCreate new content for your site:\nnpm run create [path] [flags]\r See also the Hugo docs: hugo new.\nDocs based tree #\rCreate a docs based tree â€” with a single command:\nnpm run create -- --kind docs [section]\r For example, create a docs based tree named guides:\nnpm run create -- --kind docs guides\r lint #\rCheck scripts, styles, and markdown for errors:\nnpm run lint\r scripts #\rCheck scripts for errors:\nnpm run lint:scripts [-- --fix]\r styles #\rCheck styles for errors:\nnpm run lint:styles [-- --fix]\r markdown #\rCheck markdown for errors:\nnpm run lint:markdown [-- --fix]\r clean #\rDelete temporary directories:\nnpm run clean\r start #\rStart local development server:\nnpm run start\r build #\rBuild production website:\nnpm run build\r functions #\rBuild Lambda functions:\nnpm run build:functions\r preview #\rBuild production website including draft and future content:\nnpm run build:preview\r "}),e.add({id:8,href:"/docs/help/how-to-update/",title:"How to Update",description:"Regularly update the installed npm packages to keep your Doks website stable, usable, and secure.",content:"ðŸ’¡ \rLearn more about semantic versioning and advanced range syntax. \r\rCheck for outdated packages #\rThe npm outdated command will check the registry to see if any (or, specific) installed packages are currently outdated:\nnpm outdated [[\u0026lt;@scope\u0026gt;/]\u0026lt;pkg\u0026gt; ...]\r Update packages #\rThe npm update command will update all the packages listed to the latest version (specified by the tag config), respecting semver:\nnpm update [\u0026lt;pkg\u0026gt;...]\r "}),e.add({id:9,href:"/docs/help/troubleshooting/",title:"Troubleshooting",description:"Solutions to common problems.",content:"Problems updating npm packages #\rDelete the ./node_modules folder, and run again:\nnpm install\r Problems with cache #\rDelete the temporary directories:\nnpm run clean\r "}),e.add({id:10,href:"/docs/help/faq/",title:"FAQ",description:"Answers to frequently asked questions.",content:"Hyas? #\rDoks is a Hyas theme build by the creator of Hyas.\nFooter notice? #\rPlease keep it in place.\nKeyboard shortcuts for search? #\r focus: Ctrl + / select: â†“ and â†‘ open: Enter close: Esc  Other documentation? #\r Netlify Hugo  Can I get support? #\rCreate a topic:\n Netlify Community Hugo Forums Doks Discussions  Contact the creator? #\rSend h-enk a message:\n Netlify Community Hugo Forums Doks Discussions  "}),e.add({id:11,href:"/docs/help/",title:"Help",description:"Help Doks.",content:""}),e.add({id:12,href:"/docs/odoo/odoo_api/",title:"Api de Odoo",description:"IntroducciÃ³n #\rÂ¿Para que sirve la API de Odoo?\nPodemos acceder a los datos de Odoo desde cualquiera de los mÃ³dulos internos, pero a veces interesa poder acceder a esta informaciÃ³n desde fuera. Es aquÃ­ donde entra la API de Odoo. La API nos da acceso a todos los modelos de Odoo, asÃ­ como sus vistas y sus campos. Para poder obtener toda esta informaciÃ³n usaremos XML-RPC, un protocolo de llamada a procedimiento remoto que utiliza HTTP para sus operaciones de transmisiÃ³n de mensajes, los cuales estÃ¡n codificados con XML.",content:"IntroducciÃ³n #\rÂ¿Para que sirve la API de Odoo?\nPodemos acceder a los datos de Odoo desde cualquiera de los mÃ³dulos internos, pero a veces interesa poder acceder a esta informaciÃ³n desde fuera. Es aquÃ­ donde entra la API de Odoo. La API nos da acceso a todos los modelos de Odoo, asÃ­ como sus vistas y sus campos. Para poder obtener toda esta informaciÃ³n usaremos XML-RPC, un protocolo de llamada a procedimiento remoto que utiliza HTTP para sus operaciones de transmisiÃ³n de mensajes, los cuales estÃ¡n codificados con XML.\nFuncionamiento #\rConfiguraciÃ³n #\rAntes de todo tendremos que configurar el acceso a la API. Esto se hace de la siguiente manera:\n\rurl = 'http://192.168.1.xx:8069/'\rdb = 'nombre_base'\rusername = ''\rpassword = 'contraseÃ±a'\r  url: la url de nuestro servidor de Odoo. En nuestro caso, serÃ­a la url de la mÃ¡quina virtual mÃ¡s el puerto 8069 db: el nombre de la base de datos username: el usuario con el que accederemos a los datos, nos interesa que sea el administrador para que pueda acceder a la mayor cantidad de datos password: la contraseÃ±a de dicho usuario. A partir de Odoo 14 se puede generar una clave de la api para evitar escribir la contraseÃ±a. Esta clave se pondrÃ­a en este mismo campo, sustituyendo a la contraseÃ±a.  Generar una clave para la api #\rSi estas en Odoo 14 o superior podemos generar una clave como se mencionÃ³ anteriormente. Para eso hacemos clic en la esquina superior derecha de la interfaz de Odoo (donde se encuentra nuestro nombre de usuario y la foto). A continuaciÃ³n, accedemos a Mi perfil, donde seleccionaremos Seguridad de la cuenta y por Ãºltimo haremos clic en Nueva clave de API.\nConsulta de datos que no requieren de autentificaciÃ³n #\rEs posible acceder a algunos datos sin autenticarse con la api. Por ejemplo, podemos consultar que versiÃ³n de Odoo se esta utilizando. En primer lugar, usaremos el protocolo XML-RPC usando la siguiente lÃ­nea:\nimport xmlrpc.client\r De esta forma estaremos importando todo lo necesario para consultar datos con la api.\nA partir de esto, mostraremos la informaciÃ³n de versiÃ³n de la siguiente forma:\ncommon =\rxmlrpc.client.ServerProxy('{}/xmlrpc/2/common'.format(url))\rprint(common.version())\r Con el mÃ©todo xmlrpc.client.ServerProxy accederemos a la base de datos usando la url que hayamos especificado. El â€œcommonâ€ dentro de este mÃ©todo determina que solo queremos acceder a datos que no necesitan de autentificaciÃ³n.\nComo autentificarse #\rLa mayorÃ­a de los datos de la base de datos requieren de autentificaciÃ³n. Para autentificarse usaremos el siguiente cÃ³digo:\n\rcommon =\rxmlrpc.client.ServerProxy('{}/xmlrpc/2/common'.format(url))\ruid = common.authenticate(db, username, password, {})\rmodels =\rxmlrpc.client.ServerProxy('{}/xmlrpc/2/object'.format(url))\r Como se puede ver, se estÃ¡n utilizando los datos que especificamos antes (nombre de la base de datos, usuario, contraseÃ±a y url).\nUna vez hayamos puesto estÃ¡s lÃ­neas y no haya fallos en la informaciÃ³n proporcionada podremos consultar informaciÃ³n de la base de datos.\nConsultar informaciÃ³n (mÃ©todo search y read) #\rEl mÃ©todo search nos permitirÃ¡ obtener los ids de las entradas que queramos de un modelo especÃ­fico. Por ejemplo, queremos obtener todos los contactos que sean empresas. El modelo de la aplicaciÃ³n de contactos dentro de Odoo es res.partner. Para filtrar entradas se usan los campos. Estos campos son bÃ¡sicamente las caracterÃ­sticas que tiene cada entrada y dependen del modelo. Para mirar los campos que tiene cada modelo accederemos a la lista de modelos que se encuentra en la secciÃ³n TÃ©cnico dentro de los ajustes. Dentro de res.partner podemos observar que existe un campo booleano llamado is_company que determina si el contacto se trata de una compaÃ±Ã­a o no. Para obtener los id de los contactos utilizamos esta lÃ­nea:\nprint(models.execute_kw(db, uid, password,\r'res.partner', 'search', [[['is_company', '=',\rTrue]]]))\r El mÃ©todo execute_kw lo utilizaremos para ejecutar los diversos mÃ©todos que proporciona la api (en este caso search). A search se le pasan los siguientes parÃ¡metros:\n db, uid, password: la informaciÃ³n que especificamos al principio del programa res.partner: el modelo de donde se sacarÃ¡ la informaciÃ³n search: el mÃ©todo de la api que se va a ejecutar [[[â€˜is_companyâ€™, â€˜=â€™, True]]]: la condiciÃ³n que tienen que cumplir las entradas que queremos obtener, es decir, el filtro. En este caso queremos obtener las entradas que tengan el campo is_company a True.  Esto nos devolverÃ¡ un array con los ids de las entradas que cumplan el filtro. Para obtener los proyectos que estÃ©n activos, utilizarÃ­amos lo siguiente:\n\rprint(models.execute_kw(db, uid, password,\r'project.project', 'search', [[['active', '=',\rTrue]]]))\r Como podemos ver, se ha cambiado el filtro y el modelo que usamos, que en este caso es project.project. Para mostrar mÃ¡s informaciÃ³n de las entradas tendremos que usar el mÃ©todo read. Al mÃ©todo read le pasaremos los ids obtenidos con el mÃ©todo search.\n\rids = models.execute_kw(db, uid, password, 'project.project', 'search', [[['active', '=', True]]])\rrecord = models.execute_kw(db, uid, password,\r'project.project', 'read', [ids], {'fields': ['name']})\rprint(record)\r Como se puede ver, se estÃ¡n guardando los ids obtenidos en la ejecuciÃ³n del mÃ©todo search y se le estÃ¡n pasando al mÃ©todo read. A parte de esto, se le tendrÃ¡n que pasar al read los campos que quieres que se muestren. En este caso queremos que se muestre el nombre del proyecto, por lo que lo aÃ±adimos dentro del array. Como curiosidad, a parte del nombre tambiÃ©n se mostrarÃ¡ el id siempre independientemente de que no lo especifiquemos dentro de la sentencia fields. La forma mÃ¡s Ã³ptima de hacer esto es el mÃ©todo search_read, el cual ejecutarÃ¡ automÃ¡ticamente los mÃ©todos search y read.\nmodels.execute_kw(db, uid, password, 'project.project',\r'search_read', [[['active', '=', True]]], {'fields':\r['name']})\r Su ejecuciÃ³n es muy similar a ejecutarlos de forma separada. TambiÃ©n podemos obtener todos los campos de un modelo de la siguiente manera:\nmodels.execute_kw(db, uid, password, 'res.partner', 'fields_get', [],\r{'attributes': ['string', 'help', 'type']})\r Esto nos devolverÃ¡ varias entradas que seguirÃ¡n el siguiente formato:\n\u0026quot;ean13\u0026quot;: {\r\u0026quot;type\u0026quot;: \u0026quot;char\u0026quot;,\r\u0026quot;help\u0026quot;: \u0026quot;BarCode\u0026quot;,\r\u0026quot;string\u0026quot;: \u0026quot;EAN13\u0026quot;\r},\r Siendo type el tipo de campos y help una pequeÃ±a ayuda para entender para que se usa el campo.\nCrear entradas (mÃ©todo create) #\rEste mÃ©todo es muy similar a los anteriores:\n\rid = models.execute_kw(db, uid, password,\r'project.project', 'create', [{'name': \u0026quot;Nuevo\rProyecto\u0026quot;}])\r La Ãºnica diferencia es que hay que especificarle los valores de los campos que tendrÃ¡ la nueva entrada. En este caso solo especificamos el nombre pero si quisiÃ©semos que tuviese mÃ¡s campos la entradas solo habrÃ­a que aÃ±adirlos.\nLa ejecuciÃ³n de este mÃ©todo devuelve el id de la nueva entrada creada.\nBorrar entradas (mÃ©todo unlink) #\rA este mÃ©todo hay que pasarle el id de la entrada que queramos eliminar, en este caso podemos eliminar la que creamos en el apartado anterior:\n\rmodels.execute_kw(db, uid, password, 'project.project',\r'unlink', [[id]])\r Si quisiÃ©semos eliminar todas las entradas resultantes de una bÃºsqueda, hacemos lo siguiente:\n\rid = models.execute_kw(db, uid, password,\r'project.project', 'search', [[['name', '=', \u0026quot;Nuevo\rProyecto\u0026quot;]]])\rmodels.execute_kw(db, uid, password, 'project.project',\r'unlink', [id])\r Si comparamos los dos ejemplos, hay una diferencia significativa en el mÃ©todo unlink, la forma en la que se pasan las entradas a eliminar. En el primer ejemplo, se le pasan como [[id]] ya que habÃ­amos obtenido el valor id del mÃ©todo create. Este mÃ©todo devuelve un valor numÃ©rico que representa el id de la entrada. Sin embargo, en el siguiente ejemplo el valor de la variable id se obtiene del mÃ©todo search, que devuelve un array con los resultados de la bÃºsqueda, independientemente de si esta solo ha encontrado una entrada. Esto explica la diferencia en la ejecuciÃ³n de los mÃ©todos, ya que a unlink hay que pasarle un array de arrays de entradas.\nModificar entradas (mÃ©todo write) #\rEste mÃ©todo es muy similar a unlink:\n\rmodels.execute_kw(db, uid, password, 'project.project',\r'write', [[id], {'name': \u0026quot;Newer partner\u0026quot;}])\r Al write hay que pasarle el id de la entrada y la informaciÃ³n que se quiere modificar. Esta informaciÃ³n consistirÃ¡ en el nombre del campo y un valor.\n"}),e.add({id:13,href:"/docs/",title:"Docs",description:"Docs Doks.",content:""}),search.addEventListener("input",t,!0);function t(){const s=5;var n=this.value,o=e.search(n,{limit:s,enrich:!0});const t=new Map;for(const e of o.flatMap(e=>e.result)){if(t.has(e.doc.href))continue;t.set(e.doc.href,e.doc)}if(suggestions.innerHTML="",suggestions.classList.remove("d-none"),t.size===0&&n){const e=document.createElement("div");e.innerHTML=`No results for "<strong>${n}</strong>"`,e.classList.add("suggestion__no-results"),suggestions.appendChild(e);return}for(const[r,a]of t){const n=document.createElement("div");suggestions.appendChild(n);const e=document.createElement("a");e.href=r,n.appendChild(e);const o=document.createElement("span");o.textContent=a.title,o.classList.add("suggestion__title"),e.appendChild(o);const i=document.createElement("span");if(i.textContent=a.description,i.classList.add("suggestion__description"),e.appendChild(i),suggestions.appendChild(n),suggestions.childElementCount==s)break}}})()